import "./App.css";
import { useEffect, useState } from "react";
import { getNewStoryIds } from "./APICalls/getApiStories";

const App = () => {
  const [newStories, setnewStories] = useState([]);

  useEffect(() => {
    getNewStoryIds().then((stories) => {
      setnewStories(stories);
    });
    console.log(newStories);
  }, []);

  return (
    <main>
      <div class="news-card">
        <div class="news-card-counter">
          <p>1.</p>
        </div>
        <div class="news-card-body">
          <div class="card-title">
            <span class="title">Closing 45% of the open Emacs bugs</span>{" "}
            <span class="title-url">(ingebrigtsen.no)</span>
          </div>
          <div class="card-stats">
            <span class="stats">
              72 points by clircle 1 hour ago | hide | 23 comments
            </span>
          </div>
        </div>
      </div>
      <div class="news-card">
        <div class="news-card-counter">
          <p>1.</p>
        </div>
