          <div class="card-title">
            <span class="title">Closing 45% of the open Emacs bugs</span>{" "}
            <span class="title-url">(ingebrigtsen.no)</span>
          </div>
          <div class="card-stats">
            <span class="stats">
              72 points by clircle 1 hour ago | hide | 23 comments
            </span>
          </div>
        </div>
      </div>
    </main>
  );
};

export default App;

